class QLine {
    constructor(uint32, intVal, floatVal) {
        this.uint32 = uint32 >>> 0; // Ensure uint32 is treated as unsigned
        this.intVal = intVal;       // Store an integer
        this.floatVal = floatVal;   // Store a floating-point value
    }
}

function packBooleans(bools) {
    if (bools.length > 18) {
        throw new Error("Too many booleans; only 18 can be packed.");
    }

    let packed = 0;
    for (let i = 0; i < bools.length; i++) {
        if (bools[i]) {
            packed |= (1 << i); // Set the bit at position i
        }
    }
    return packed >>> 0; // Ensure the result is treated as unsigned
}

class TTTBoard {
    constructor(){
        this.bools = Array(18).fill(false);
    }

    reset() {
        this.bools.fill(false);
    }

    isOccupied(index){
        if (this.bools[index])
        {
            return true;
        }
        else return false;
    }
    
    isOccupiedAndType(index, isX)
    {
        if (this.bools[index] && this.bools[index+9] == isX)
        {return true; }
        return false;
    }

    isWinner(theType)
    {
        //X
        
        if( ( this.isOccupiedAndType(0, theType) && this.isOccupiedAndType(1, theType) && this.isOccupiedAndType(2, theType) ) ||
        ( this.isOccupiedAndType(3, theType) && this.isOccupiedAndType(4, theType) && this.isOccupiedAndType(5, theType) ) ||
        ( this.isOccupiedAndType(6, theType) && this.isOccupiedAndType(7, theType) && this.isOccupiedAndType(8, theType) ) )
        {
            return true;
        }
        if( ( this.isOccupiedAndType(0, theType) && this.isOccupiedAndType(3, theType) && this.isOccupiedAndType(6, theType) ) ||
        ( this.isOccupiedAndType(1, theType) && this.isOccupiedAndType(4, theType) && this.isOccupiedAndType(7, theType) ) ||
        ( this.isOccupiedAndType(2, theType) && this.isOccupiedAndType(5, theType) && this.isOccupiedAndType(8, theType) ) )
        {
            return true;
        }
        if( ( this.isOccupiedAndType(0, theType) && this.isOccupiedAndType(4, theType) && this.isOccupiedAndType(8, theType) ) ||
        ( this.isOccupiedAndType(2, theType) && this.isOccupiedAndType(4, theType) && this.isOccupiedAndType(6, theType) ) )
        {
            return true;
        }
        return false;
    }
    isDraw()
    {
        let filledBoxes=0;
        for(let i=0; i<9;i++)
        {
            if(this.bools[i])
            {
                filledBoxes++;
            }
        }
        console.log('filled boxes:', filledBoxes );
        if (filledBoxes ==9) {return true;}
        return false;
    }
}

